import "./App.css";
import "react-image-gallery/styles/css/image-gallery.css";
import ReactDOM from "react-dom";
import { BrowserRouter as Router } from "react-router-dom";
import Home from "./pages/Home";
import Work from "./pages/Work";

import AboutMe from "./pages/AboutMe";
import ContactMe from "./pages/ContactMe";
import { useViewportScroll, motion, useTransform } from "framer-motion";



function App() {
  return (
    <Router>
      <Home />
      <Work />
      <AboutMe />
      <ContactMe />
      <ParallaxBackground />
    </Router>
  );
}

export default App;
function ParallaxBackground() {
  const { scrollY } = useViewportScroll();
  const y1 = useTransform(scrollY, [1000, 3100], [-2500, 0]);
  const y2 = useTransform(scrollY, [700, 3100], [-2250, 0]);
  const y3 = useTransform(scrollY, [300, 3100], [-2250, 0]);
  const y4 = useTransform(scrollY, [560, 3100], [-2250, 0]);
  const y5 = useTransform(scrollY, [200, 3100], [-2250, 0]);
  const y6 = useTransform(scrollY, [1320, 3100], [-2250, 0]);

  return (
    <>
      <div className="bodyDiv">
        <motion.div className="box" style={{ y: y1, x: -50 }}>
          <img src="https://res.cloudinary.com/josip-kuki/image/upload/v1620953429/ShipOuter_nalkfx.png"></img>
        </motion.div>
        <motion.div
          className="box"
          style={{ y: y2, x: 50, }}
        ><img src="https://res.cloudinary.com/josip-kuki/image/upload/v1620953429/ShipInner_jhvznn.png"></img>
        </motion.div>
        <motion.div
          className="box"
          style={{ y: y3, x: 0,}}
        >
        <img src="https://res.cloudinary.com/josip-kuki/image/upload/v1620953429/ShipSailsBack_aguktr.png"></img>
        </motion.div>
        <motion.div className="box" style={{ y: y4, x: -50 }}>
          <img src="https://res.cloudinary.com/josip-kuki/image/upload/v1620953429/ShipSailsFront_kecmoj.png"></img>
        </motion.div>
        <motion.div className="box" style={{ y: y5, x: -50 }}>
          <img src="https://res.cloudinary.com/josip-kuki/image/upload/v1620953429/LadyV_u3tovx.png"></img>
        </motion.div>
        <motion.div className="box" style={{ y: y6, x: -50 }}>
          <img src="https://res.cloudinary.com/josip-kuki/image/upload/v1620953430/ShipMasts_dg4rtt.png"></img>
        </motion.div>

      </div>
    </>
  );
}
const rootElement = document.getElementById("root");
ReactDOM.render(<ParallaxBackground />, rootElement);
